import React from "react";
import "../../../map.css";
import "./style.css";

const A1 = () => (
   
        <div id="a1">
          <p>Welcome to Truffle! </p>
          <img id="truffle-shuffle" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/img/truffle_shuffle.png" 
            alt="truffle-shuffle" />

        </div>
      )
      
export default A1;
